import React from 'react';
import '../index.css';
import { Button } from './Button';
import '../App.css';
import './Main.css';
import ParticleBackground from './ParticleBackground';


function Main() {
    return (
        <div className='flex flex-col flex-1 p-4'>
            <section className='grid grid-cols-1 lg:grid-cols-2 gap-10 py-8 sm:py-14'>
                <div className='flex flex-col lg:justify-center text-center lg:text-left gap-6 md:gap-8 lg:gap-10'>
                    <h2 className='font-semibold text-4xl sm:text-5xl md:text-6xl'>
                        Hi! I'm <span className='poppins text-violet-400'>Dev</span> Patel
                        <br /> Full Stack
                        <span className='poppins text-violet-400'>Developer</span>
                    </h2>
                    <p class="text-base sm:text-lg md:text-xl">
                        Computer Science | Business | <span className='text-violet-400'>UNC</span>
                    </p>
                    <Button buttonStyle='btn--primary' buttonSize='btn--large'>
                        DISCOVER MORE
                    </Button>
                </div>

            </section>

        </div>
    )
}

export default Main
